  E'Federal Decree-Law No. 47 of 2022 - Unofficial translation 
 
1 
Federal Decree-Law No. 47 of 2022 on the Taxation of Corporations and Businesses
 
 
His Highness Sheikh Mohamed bin Zayed Al Nahyan, President of the United Arab Emirates, 
has issued the following Decree-Law: 
 
 
- Having reviewed the Constitution, 
- Federal Law No. 1 of 1972 on the Competencies of Ministries and Powers of the Ministers, 
and its amendments,  
- Federal Law No. 26 of 1981 on the Commercial Maritime Law, and its amendments, 
- Federal Law No. 5 of 1985 promulgating the Civil Transactions Law, and its amendments, 
- Federal Law No. 18 of 1993 promulgating the Commercial Transactions Law, and its 
amendments, 
- Federal Law No. 4 of 2000 on the Emirates Securities and Commodities Authority and 
Market, and its amendments, 
- Federal Law No. 8 of 2004 on the Financial Free Zones, 
- Federal Law No. 6 of 2007 on the Regulation of Insurance Operations, and its 
amendments, 
- Federal Law No.',
