  E'Federal Decree-Law No. 47 of 2022 - Unofficial translation 
 
2 
- Federal Decree-Law No. 35 of 2022 promulgating the Law of Evidence in Civil and 
Commercial Transactions,  
- Pursuant to what was presented by the Minister of Finance and approved by the Cabinet, 
 
Chapter One  General provisions  
Article 1  Definitions  
In the application of the provisions of this Decree-Law, the following words and expressions 
shall have the meanings assigned against each, unless the context otherwise requires: 
 
State 
: United Arab Emirates. 
Federal Government 
: The government of the United Arab Emirates. 
Local Government 
: Any of the governments of the Member Emirates of the 
Federation. 
Ministry 
: Ministry of Finance. 
Minister  
: Minister of Finance. 
Authority  
: Federal Tax Authority. 
Corporate Tax 
