  'a1b2c3d4-e5f6-7890-abcd-ef1234567890',
  E'ter of Finance. 
Authority  
: Federal Tax Authority. 
Corporate Tax 
: The tax imposed by this Decree-Law on juridical persons 
and Business income. 
Business 
: Any activity conducted regularly, on an ongoing and 
independent basis by any Person and in any location, such 
as 
industrial, 
commercial, 
agricultural, 
vocational, 
professional, service or excavation activities or any other 
activity related to the use of tangible or intangible 
properties.  
Qualifying Income 
: Any income derived by a Qualifying Free Zone Person that 
is subject to Corporate Tax at the rate specified in 
paragraph (a) of Clause 2 of Article 3 of this Decree-Law. 
Government Entity 
: The Federal Government, Local Governments, ministries, 
government 
departments, 
government 
agencies, 
authorities and public institutions of the Federal 
Government or Local Governments.',
